import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header>
      <h1>
        <img
          src="/assets/icons/casa (1).png"
          alt="Inicio"
          style={{ width: '24px', height: '24px', verticalAlign: 'middle', marginRight: '8px' }}
        />
      </h1>
    </header>
  );
};

export default Header;
